import React, {useEffect, useState} from 'react'
import './SignIn.css'

function CheckSignIn(){
    const [message, setMessage] = useState([]);

    useEffect(() => {
        fetch("/hello")
            .then((response) => {
                return response.json();
            })
            .then(function (data) {
                setMessage(data);
            });
    }, []);
    console.log("message");
    return (
        <div className = "titleDiv">
            <h1 id = "homeTitle" className="title">Welcome!</h1>
            <ul>
                {message.map((text, index) => <li key={`${index}-${text}`}>{text}</li>)}
            </ul>
        </div>
    )
}
const SignIn = () => {
    return (
        <>
            <div className = "signInDiv">
                <form className = "signInForm" onSubmit={CheckSignIn}>
                    <h1 id = "signInTitle" className = "title"> Welcome back!</h1>
                    <label>
                        Email:<br />
                        <input type="email" name="name" /><br/><br/>
                    </label>
                    <label>
                        Password:<br />
                        <input type="password" name="name" /><br/><br/>
                    </label>
                    <input type="submit" value="Submit" className = "submitButton"/>
                </form>
            </div>
            <div className = "signUpDiv">
                <a className = "signUpLink" href = "http://localhost:3000/sign-up">Not a member yet? Sign up!</a>
            </div>
        </>
    )
}

export default SignIn;
